Component({
  mixins: [],
  data: {},
  props: {
    checked: false,
    disabled: false
  },
  didMount: function didMount() {
    this.setData({
      _checked: this.props.checked
    });
  },
  didUpdate: function didUpdate() {},
  didUnmount: function didUnmount() {},
  methods: {
    onChange: function onChange() {
      var onChange = this.props.onChange;

      if (onChange) {
        onChange({
          detail: {
            value: !this.props.checked
          }
        });
      }
    }
  }
});